import React from 'react'
import { Navigate, Route } from 'react-router-dom';

export default function PrivateRoute({ component: Component, isAuthenticated, ...rest }) {
    console.log(rest)
    return (
        Routes>
        <Route
            {...rest}
            render={({ location }) =>
                isAuthenticated ? (
                    <Component />
                ) : (
                    <Navigate
                        to={{
                            pathname: '/',
                            state: { from: location }
                        }}
                    />
                )
            }
        />
    )
}
